import React from 'react'
import { useRouter } from 'next/router'
import { SIDENAV } from '../../constants'
import Button from './button'
import cn from 'classnames'
import Link from 'next/link'

import styles from './sidebar.module.css'

function SideBar({ href, children, ...props }) {
    const router = useRouter()
    return (
        <div>
            <nav className={styles.menu} tabIndex="0">
                <div className={styles.smartphonemenutrigger}></div>
                <header className={styles.avatar}>
                    <img src="https://logos-download.com/wp-content/uploads/2016/04/Burger_King_logo_emblem-2.png" />
                    <h2>Burger King</h2>
                </header>
                <ul>
                    {SIDENAV.map((menu) => {
                        const selected = router.pathname === menu.path
                        return (
                            <li tabIndex="0">
                                <Button key={menu.key} href={menu.path}>
                                    {selected ? menu.iconSelected : menu.icon}
                                    {menu.title}
                                </Button>
                            </li>
                        )
                    })}
                </ul>
            </nav>
        </div>
    )
}

export default SideBar
